import React from "react"

export default function Data() {
  return (
      All_data = [
      { title: "Card 1", content: "This is the content of Card 1." },
      { title: "Card 2", content: "This is the content of Card 2." },
      { title: "Card 3", content: "This is the content of Card 3." },
      { title: "Card 4", content: "This is the content of Card 1." },
      { title: "Card 5", content: "This is the content of Card 1." },
      { title: "Card 6", content: "This is the content of Card 2." },
      { title: "Card 7", content: "This is the content of Card 3." },
      { title: "Card 8", content: "This is the content of Card 1." }
    ]
  );
}
